import { data } from "../../utils/data";
import { Logo } from '@ya.praktikum/react-developer-burger-ui-components';
import { BurgerIcon } from '@ya.praktikum/react-developer-burger-ui-components';

function App() {
  return (
    <div className={styles.app}>
      <Logo />
      <div>
        <BurgerIcon />
        <p>Конструктор</p>
      </div>

    </div>
  );
}

export default App;
